import React from 'react'

const TableData = ({ tableData }) => {
    return (
        <div>
            <table>
                <tr>
                    {
                        tableData?.header?.map(el=>{
                            return(
                            <th>{el}</th>
                            )
                        })
                    }
                </tr>
                {
                    tableData?.data?.map(el=>{
                        return(
                            <tr>
                                <td>{el?.id}</td>
                                <td>{el?.customerName}</td>
                                <td>{el?.Profession}</td>
                            </tr>
                        )
                    })
                }

            </table>
        </div>
    )
}

export default TableData;
